import React from "react";

// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Thumbs, Keyboard } from "swiper";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";

const Carousel = () => {
  const swiper = new Swiper(".swiper", {
    autoplay: {
      delay: 5000,
    },
  });
  return (
    <div>
      <Swiper
        loop={true}
        spaceBetween={0}
        navigation={true}
        keyboard={true}
        modules={[Navigation, Keyboard]}
        grabCursor={true}
        autoplay={true}
      >
        <SwiperSlide>
          <img
            src="./uploads/events/default-event.jpg"
            alt="event"
            width="1310vh"
          />
        </SwiperSlide>
        <SwiperSlide>
          <img
            src="./uploads/events/default-event.jpg"
            alt="event"
            width="1310vh"
          />
        </SwiperSlide>
        <SwiperSlide>
          <img
            src="./uploads/events/default-event.jpg"
            alt="event"
            width="1310vh"
          />
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Carousel;
